/*
1.res.json
2.res.status
3.res.send
*/

export default (req,res)=>{
    res.status(200)
    res.send(
        <html>
            <p>admin</p>
        </html>
    )
    res.json({
        user:"wolker",
        password:"wolker123"
    })
}
